<section id="" class="resource-group"><h2 class="group-heading">Resource Group <a href="#" class="permalink">&para;</a></h2><div id="get-boundaries-by-zipcodes" class="resource"><h3 class="resource-heading">Get Boundaries by zipcodes <a href="#get-boundaries-by-zipcodes" class="permalink">&nbsp;&para;</a></h3><div id="get-boundaries-by-zipcodes-get" class="action get"><h4 class="action-heading"><div class="name">Get Boundaries by zipcodes</div><a href="#get-boundaries-by-zipcodes-get" class="method get">GET</a><code class="uri">/api/zips/boundaries{?q}{&amp;file}{&amp;geojson}</code></h4><p>Get all the boundaries given a comma-delimited list of Zipcodes</p>
<h4>Example URI</h4><div class="definition"><span class="method get">GET</span>&nbsp;<span class="uri"><span class="hostname"></span>/api/zips/boundaries?<span class="hljs-attribute">q=</span><span class="hljs-literal"></span>&<span class="hljs-attribute">file=</span><span class="hljs-literal"></span>&<span class="hljs-attribute">geojson=</span><span class="hljs-literal"></span></span></div><div class="title"><strong>URI Parameters</strong><div class="collapse-button show"><span class="close">Hide</span><span class="open">Show</span></div></div><div class="collapse-content"><dl class="inner"><dt>q</dt><dd><code>string</code>&nbsp;<span class="required">(required)</span>&nbsp;<p>comma-delimited list of Zipcodes</p>
</dd><dt>file</dt><dd><code>boolean</code>&nbsp;<span>(optional)</span>&nbsp;<p>if <code>true</code>, the response will be downloaded as a file.
Default: <code>false</code></p>
</dd><dt>geojson</dt><dd><code>boolean</code>&nbsp;<span>(optional)</span>&nbsp;<p>if true, the response will be formated as valid GeoJSON.  Otherwise, it will be wrapped within <code>data</code> along with a <code>status</code> property.
Default: <code>false</code></p>
</dd></dl></div><div class="title"><strong>Response&nbsp;&nbsp;<code>200</code></strong><div class="collapse-button"><span class="close">Hide</span><span class="open">Show</span></div></div><div class="collapse-content"><div class="inner"><h5>Headers</h5><pre><code><span class="hljs-attribute">Content-Type</span>: <span class="hljs-string">application/json</span></code></pre><div style="height: 1px;"></div><h5>Body</h5><pre><code>{
