  </span>}
</span>}</code></pre><div style="height: 1px;"></div></div></div></div></div><div id="get-boundaries-by-city-name" class="resource"><h3 class="resource-heading">Get Boundaries by city name <a href="#get-boundaries-by-city-name" class="permalink">&nbsp;&para;</a></h3><div id="get-boundaries-by-city-name-get" class="action get"><h4 class="action-heading"><div class="name">Get Boundaries by city name</div><a href="#get-boundaries-by-city-name-get" class="method get">GET</a><code class="uri">/api/zips/boundaries/search{?city}{&amp;state}{&amp;file}{&amp;geojson}</code></h4><p>Get all the boundaries given a city name and state abbreviation</p>
<h4>Example URI</h4><div class="definition"><span class="method get">GET</span>&nbsp;<span class="uri"><span class="hostname"></span>/api/zips/boundaries/search?<span class="hljs-attribute">city=</span><span class="hljs-literal"></span>&<span class="hljs-attribute">state=</span><span class="hljs-literal"></span>&<span class="hljs-attribute">file=</span><span class="hljs-literal"></span>&<span class="hljs-attribute">geojson=</span><span class="hljs-literal"></span></span></div><div class="title"><strong>URI Parameters</strong><div class="collapse-button show"><span class="close">Hide</span><span class="open">Show</span></div></div><div class="collapse-content"><dl class="inner"><dt>city</dt><dd><code>string</code>&nbsp;<span class="required">(required)</span>&nbsp;<p>City Name</p>
